import React, { Component } from "react";
import axios from "axios";

export default class EditTour extends Component {
  constructor(props) {
    super(props);
    this.state = {
      id: this.props.id,
      tour: ""
    };
  }
  componentDidMount() {
    axios.get("http://127.0.0.1:8000/api/react").then(res => {
      this.setState({
        tour: res.data
      });
    });
  }
  render() {
    return (
      <div>
        <label>Tour</label>
        <input placeholder="tour" />
      </div>
    );
  }
}
